var yearBorn = document.getElementById("year");
var inputFemale = document.getElementById("female");
var inputMasculine = document.getElementById("masculine");
var div = document.querySelector("div.result");

function handleCheck() {
  const currentatualYear = new Date().getFullYear();

  const genIsEmpety = !inputFemale.checked && !inputMasculine.checked;

  if (!yearBorn.value || yearBorn.value > currentatualYear || genIsEmpety) {
    alert("Por favor preencha os dados de forma correta!");

    return;
  }

  var age = currentatualYear - yearBorn.value;
  var gen = inputMasculine.checked ? "Homem" : "Mulher";
  var message = `Detectamos ${gen} com ${age} anos.`;

  if (gen === "Homem") {
    if (age >= 0 && age <= 10) {
      message +=
        "<img src='https://a-static.mlcdn.com.br/618x463/camiseta-banda-de-rock-audioslav-crianca-homem-camisa-adult-vetor-camisaria/vetorecommerce/7403371555/7d93167949724849b3a5d0278e0c7013.jpg' alt='Criança'/>";
    } else if (age < 21) {
      message +=
        "<img src='data:image/jpeg;base64,' alt='Jovem'/>";
    } else if (age < 50) {
      message +=
        "<img src='data:image/jpeg;base64,' alt='AdultA'/>";
    } else {
      message +=
        "<img src='data:image/jpeg;base64,' alt='Idoso'/>";
    }
  } else if (gen === "Mulher") {
    if (age >= 0 && age <= 10) {
      message +=
        "<img src='data:image/jpeg;base64,' alt='Criança'/>";
    } else if (age < 21) {
      message +=
        "<img src='https://img.freepik.com/fotos-gratis/mulher-rosto-sorridente-com-cabelos-encaracolados_1139-582.jpg?size=626&ext=jpg' alt='Jovem'/>";
    } else if (age < 50) {
      message +=
        "<img src='data:image/jpeg;base64,' alt='Adulta'/>";
    } else {
      message +=
        "<img src='https://www.onconews.com.br/site/images/artigos/Idosa.jpg' alt='Idosa'/>";
    }
  }

  div.innerHTML = message;
}
